import React, {Component, Fragment} from 'react';
import {Link, withRouter} from 'react-router-dom';
import {connect} from "react-redux";
import {logoutUser} from "../../store/actions/auth";
import {db_get_recent_job, db_get_all_paid_jobs} from "../../store/actions/jobs";
import getTime from '../../utils/getTime';
import {WORKER_RATE} from '../../utils/constants';
import moment from 'moment';
import empty from 'is-empty';

import Navbar from '../../components/Nav/Navbar';
import Loading from '../../components/Graphics/Loading';
import ProductCard from '../../Forms/ProductCard';

import test from '../../images/dadshort.png';
import test2 from '../../images/spottedsweatshirt.png';

class Products extends Component {
	constructor(props) {
		super(props);
		this.state = {
			loaded: false,
			products: []
		};
	}

  async componentDidMount() {
  	this.setState({
  		loaded: true
  	});
  }



	render() {
		const {job, needsPayment} = this.state;
		return (
			<Fragment>
				<Navbar active="home" items={1}/>
				{!this.state.loaded && (<Loading />)}
				{this.state.loaded && (<div className="dashboard-container">
					<div className="dashboard-box">
						<div className="dashboard-side">
							<img src={test} alt="" className="product-photo"/>
							<div className="product-description">
								<span className="product-title">Product</span>
								<span>Price</span>
								<div className="size-input-div">
									<div className="size-input-choice">
										<input type="text" className="size-input"/>
										<span>S</span>
									</div>
									<div className="size-input-choice">
										<input type="text" className="size-input"/>
										<span>M</span>
									</div>
									<div className="size-input-choice">
										<input type="text" className="size-input"/>
										<span>L</span>
									</div>
									<div className="size-input-choice">
										<input type="text" className="size-input"/>
										<span>XL</span>
									</div>
								</div>
								<button className="add-to-cart">Add to Cart</button>
							</div>
						</div>
						<div className="dashboard-side">
							<img src={test2} alt="" className="product-photo"/>
							<div className="product-description">
								<span className="product-title">Product</span>
								<span>Price</span>
								<div className="size-input-div">
									<div className="size-input-choice">
										<input type="text" className="size-input"/>
										<span>S</span>
									</div>
									<div className="size-input-choice">
										<input type="text" className="size-input"/>
										<span>M</span>
									</div>
									<div className="size-input-choice">
										<input type="text" className="size-input"/>
										<span>L</span>
									</div>
									<div className="size-input-choice">
										<input type="text" className="size-input"/>
										<span>XL</span>
									</div>
								</div>
								<button className="add-to-cart">Add to Cart</button>
							</div>
						</div>
					</div>
				</div>)}
			</Fragment>
		)
	}
}

const mapStateToProps = state => ({
  user: state.auth.user
});

export default connect(mapStateToProps,{logoutUser})(withRouter(Products));
